// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract MedicalRecord {
    
    struct Patient {
        address patientAddress;
        string fullName;
        string dateOfBirth;
        string location;
    }
    mapping(address => Patient) patients;

    struct Record {
        address patientAddress;
        string recordDesc;
        string recordEnteredBy;
        string recordTimestamp;
    }
    mapping(address => Record) records;

    // Add a new patient
    function addPatient(address _patientAddress, string memory _fullName, string memory _dateOfBirth, string memory _location) public returns (string memory){
        //require(msg.sender == _patientAddress);
        patients[_patientAddress] = Patient(_patientAddress, _fullName, _dateOfBirth, _location);
        return _fullName;
    }

    function addRecord(address _patientAddress, string memory _recordDesc, string memory _recordEnteredBy, string memory _recordTimestamp) public returns  (string memory,string memory) {
        
        require(patients[_patientAddress].patientAddress == _patientAddress);
      
        records[ patients[_patientAddress].patientAddress] = Record(_patientAddress, _recordDesc,_recordEnteredBy, _recordTimestamp);
        return (_recordTimestamp,patients[_patientAddress].fullName);
    }

    function getRecord(address _patientAddress) public view returns (address, string memory, string memory, string memory, string memory, string memory) {

        require(patients[_patientAddress].patientAddress == _patientAddress);
       
                return (records[_patientAddress].patientAddress, records[_patientAddress].recordDesc, records[_patientAddress].recordEnteredBy, patients[_patientAddress].fullName,patients[_patientAddress].dateOfBirth,patients[_patientAddress].location);
            
    
    }
}
